import React from 'react';
export default function Sidebar({onNavigate, token, onLogout}){
  return (<div className="sidebar">
    <button className="btn" onClick={()=>onNavigate('home')}>Home</button>
    <button className="btn" onClick={()=>onNavigate('states')}>States</button>
    <button className="btn" onClick={()=>onNavigate('addplace')}>Add Place</button>
    <button className="btn" onClick={()=>onNavigate('profile')}>Profile</button>
    {!token ? <button className="btn" onClick={()=>onNavigate('login')}>Login / Signup</button> : <button className="btn" onClick={onLogout}>Logout</button>}
  </div>)
}
